import "./App.css";
import { useEffect, useState } from "react";
import getData from "./api/api";

function App() {
  const [data, setData] = useState({});

  useEffect(() => {
    async function fetchData() {
      const result = await getData();
      setData(result);
      console.log(result);
    }

    fetchData();
  }, []);

  return (
    <div className="App">
      <p>Hello World</p>
    </div>
  );
}

export default App;
